Menorrhagia is the medical term for heavy menstrual bleeding. This means that a woman‚Äôs period is either longer or heavier (or both) than normal, resulting in a greater blood loss. Menorrhagia is considered a bleeding disorder.‚Å£
‚Å£
Menorrhagia affects 30 percent of women of reproductive age and is the leading cause of hysterectomy in women under 60.‚Å£
‚Å£
Menorrhagia symptoms include:‚Å£
‚Å£
üëâ Heavy menstrual bleeding‚Å£
üëâ Bleeding for longer than 7 days‚Å£
üëâ Loss of more than 3 ounces of blood during a menstrual cycle‚Å£
üëâ Passing large blood clots, larger than a quarter‚Å£
üëâ Irregular bleeding between periods‚Å£
üëâ Iron deficiency or iron deficiency anemia secondary to blood loss‚Å£
